import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import {useEffect} from 'react';


function App() {


  const demoApi = async()=>{

    try {

      const data = await axios.get(`https://api.dictionaryapi.dev/api/v2/entries/en_US/hello`);
      console.log(data);
    } catch (error) {

      console.log(error)
    }
  }

  useEffect(() => { demoApi()
  }, [])

  return <div className="App"/>

}

export default App;
